printScore: ;exibir a pontuao da partida:
	mov ah, 0x13 ;Printar string
	mov al, 1 ;tipo de escrita
	mov bl, 15 ;cor
	mov dh, 2 ;linha
	mov dl, 16 ;coluna
	mov cx, 6 ;numero de caracteres
	mov bp, score
	int 10h
	ret
Score: ;atualizar a pontuao da partida:
	mov ah, 2
	mov dh, 2
	mov dl, 22
	int 10h
	mov si, num_score
	lodsw
	xor bx, bx
	cen:
		cmp ax, 100
		jb fim_cen
		sub ax, 100
		inc bl
		jmp cen
	fim_cen:
		add bl, 48
		push ax
		mov al, bl
		mov ah, 0xe
		mov bl, 15
		int 10h
		mov bl, 0
		pop ax
	dez:
		cmp ax, 10
		jb fim_dez
		sub ax, 10
		inc bl
		jmp dez
	fim_dez:
		add bl, 48
		push ax
		mov al, bl
		mov ah, 0xe
		mov bl, 15
		int 10h
		mov bl, 0
		pop ax
	un:
		add al, 48
		mov ah, 0xe
		mov bl, 15
		int 10h
		mov bl, 0
		ret
update_score:
	mov si, num_score
	mov di, num_score
	lodsw
	inc ax
	stosb
	mov si, speed_fuja
	mov di, speed_fuja
	lodsw
	cmp ax, 0
	je vel_max
	sub ax, 500
	stosw
	call Score
	jmp verifica_pulo
vel_max: ;no deixa passar da velocidade mxima
	stosw
	call Score
	jmp verifica_pulo
