mov_ruy:
	mov si, Ruy_img
	mov dx, 123
	loop1_mov_Ruy:
		push si
		mov si, ruy_x
		lodsw 
		pop si
		mov cx, ax
		sub cx, 5
		push cx
		cmp dx, 146 ;23 linhas
		je fim_loop1_mov_Ruy
		loop2mov_Ruy:
			pop ax
			push ax
			add ax, 20 ;20 colunas
			cmp cx, ax
			je fim_loop2mov_Ruy
			lodsb ; al = 0/
			mov ah, 0xc
			int 10h
			pop ax
			push ax
			dec ax
			push cx
			mov cx, ax
			mov ah, 0xd
			int 10h
			cmp al, 0
			jne end_game
			pop cx
			inc cx
			jmp loop2mov_Ruy
		fim_loop2mov_Ruy:
			inc dx
			pop ax
			jmp loop1_mov_Ruy
	fim_loop1_mov_Ruy:
		pop ax
		mov di, ruy_x
		stosw
		cmp ax, 0
		je new_ruy
		cmp ax, 35
		je update_score
		jmp verifica_pulo
